import React from "react";
import { Link } from "react-router-dom";

export default () => {
  return (
    <div className="page-main__wrapper">
      <nav className="main__nav">
        <button>Home</button>
        <button>SignUp</button>
        <button>Login</button>
      </nav>
    </div>
  )
}

